var addToArrayForm = function (A, K) {

    // 
    let res = []    // 
    let KVal = K
    let KList = []  // K 
    let carry = 0


    // 1
    while (KVal > 0) {
        KList = [Math.floor(KVal % 10), ...KList]
        KVal = Math.floor(KVal / 10)
    }

    // 2 A  KList 
    let judgeNum = A.length - KList.length
    let zeroList = new Array(Math.abs(judgeNum)).fill(0)
    if (judgeNum > 0) {
        KList = [...zeroList, ...KList]
    } else {
        A = [...zeroList, ...A]
    }

    // 3
    for (let i = A.length - 1; i >= 0; i--) {

        // 
        let resSingle = A[i] + KList[i] + carry
        let resVal = Math.floor(resSingle % 10)
        carry = Math.floor(resSingle / 10)
        res = [resVal, ...res]
    }

    // 4
    if(carry > 0) res = [carry, ...res]

    return res
};
