vector<int> addToArrayForm(vector<int>& num, int k) {
    if (!k) return num;
    vector<int> n;
    while (k) {
        n.push_back(k % 10);
        k /= 10;
    }
    reverse(num.begin(), num.end());
    int plus = 0, ptr = 0;
    int len = min(num.size(), n.size());
    vector<int> res;
    while (ptr < len) {
        int temp = num[ptr] + n[ptr] + plus;
        res.push_back(temp % 10);
        plus = temp / 10;
        ++ptr;
    }
    if (ptr == num.size()) {
        while (ptr < n.size()) {
            int temp = n[ptr] + plus;
            res.push_back(temp % 10);
            plus = temp / 10;
            ++ptr;
        }
    } else {
        while (ptr < num.size()) {
            int temp = num[ptr] + plus;
            res.push_back(temp % 10);
            plus = temp / 10;
            ++ptr;
        }
    }
    if (plus) res.push_back(1);
    reverse(res.begin(), res.end());
    return res;
}
