public:
    vector<int> addToArrayForm(vector<int> &num, int k)
    {
        vector<int> ans;
        int len = num.size();
        for (int i = len - 1; i >= 0; i--)
        {
            k += num[i];
            ans.push_back(k % 10);
            k /= 10;
        }
        while (k > 0)
        {
            ans.push_back(k % 10);
            k /= 10;
            len++;
        }
        for (int i = 0, j = len - 1; i < j;)
        {
            swap(ans[i], ans[j]);
            i++;
            j--;
        }
        return ans;
    }
};
